class Solution:
    def __init__(self):
        self.xhs={}
        self.ohs={}
        self.h = 0
        self.w = 0
    # @param board, a 2D array
    # Capture all regions by modifying the input board in-place.
    # Do not return any value.
    def solve(self, board):
        if board == None:
            return
        self.h = len(board)
        if self.h==1 or self.h==0:
            return
        for row in range(self.h):
            board[row] = list(board[row])
        self.w = len(board[0])
        for i in range(0,self.h):
            for j in range(0,self.w):
                key = i * self.w + j
                if self.xhs.get(key)!=None or self.ohs.get(key)!=None or board[i][j]=='X':
                    continue
                self.search(board,i,j)
                
        self.fillx(board)
        
        #print self.ohs
        #print self.xhs
        #print board
        
    def fillx(self,board):
        for key,xy in self.ohs.items():
            board[xy[0]][xy[1]] = 'X'
            
    def search(self,board,y,x):
        dp = [(y,x)]
        l=[]
        t={}
        kind = 'o'
        while len(dp)>0:
            item = dp.pop()
            i,j = item[0],item[1]
            if i>=self.h or i<0 or j>=self.w or j < 0:
                continue
            #print dp
            key = i * self.w + j
            if self.xhs.get(key)!=None or self.ohs.get(key)!=None or t.get(key)!=None:
                continue
            t[key]=0
            if board[i][j]=='O':
                if i==0 or i == self.h - 1 or j==0 or j == self.w - 1:
                    kind='x'
                
                l.append((i,j))
                dp.append((i+1,j))
                dp.append((i-1,j))
                dp.append((i,j-1))
                dp.append((i,j+1))
        
        for item in l:
            key = item[0] * self.w + item[1]
            if kind=='o':
                self.ohs[key] = item
            else:
                self.xhs[key] = item
        
